2. Mechanisms interaction: We postulate that the participant computes the fairness ratio as token_opp divided by total tokens (token_self + token_opp). Subtracting 0.5 centers this ratio so that a value of zero reflects an equal contribution. The proposer then adjusts a baseline 50% proposal by an additive bias and by a multiplicative scaling of this centered fairness ratio.

3. Mathematical form: This interaction is captured by a simple linear function. The predicted percentage for the opponent is given by an intercept (set at 50% plus an additional bias parameter delta) plus a scaling (100×γ) of the deviation from equal contributions.

4. Model parameters: The model has two learnable parameters: delta (a bias term) and gamma (the fairness‐sensitivity parameter). Finite generous bounds are provided to both parameters.

