def simulate_model(trial_data, delta=0, gamma=0):
    model_predictions = []
    for trial in trial_data:
        token_opp = trial.get("token_opp", 0)
        token_self = trial.get("token_self", 0)

        # Handle the case where both token_self and token_opp are zero to avoid division by zero
        if token_self + token_opp == 0:
            fairness_ratio = 0  # Or any other reasonable default
        else:
            fairness_ratio = (token_opp) / (token_self + token_opp)

        proposed_perc = 50 + delta + 100 * gamma * (fairness_ratio - 0.5)
        model_predictions.append(proposed_perc)
    return model_predictions
